window.bookSummaryJSON = "<p><b>A college girl is found dead.<br> A grieving mother searching for answers<br> Castle sets out to uncover the truth.<br> Tracking Justice comes at a cost.</b><br> <br> When a college girl is found dead, the investigation leaves a distraught mother in a desperate quest to find out what happened. Dissatisfied with the conclusion drawn by police, she continues to hunt for the truth behind her daughter's untimely death.<br> <br> Retired K9 handler Maddie Castle is brought in to assist the family. With the help of her partner Tempest, Castle finds a lead. She begins to peel back the layers, and discovers the evidence points to murder. Proving it will take all of Castle's investigative effort. Surviving the fallout comes at a price.<br> <br> With Tempest at her side, Castle is on the trail of a murderer who's willing to stop at nothing to keep the truth from being exposed. If she can solve the case, it will be the biggest payday to date. But the cost for Tracking Justice comes at price. And if she's not careful it could be her life.<br> <br> Join Maddie Castle and her K9 Tempest on their latest heart-pumping adventure.</p>"; 
